import React from 'react';
import styles from './NewsArchive.module.css';
import newsImage1 from '../../assets/images/news/ai_matching.jpg';
import blogImage1 from '../../assets/images/news/microservices.jpg';
import newsImage2 from '../../assets/images/news/growth_chart.jpg';

interface NewsItem {
  category: string;
  date: string;
  title: string;
  description: string;
  image: string;
}

export const NewsArchive: React.FC = () => {
  const newsItems: NewsItem[] = [
    {
      category: 'ニュース',
      date: '2024.03.15',
      title: '新しい人材マッチングAIエンジンをリリース',
      description: '最新のAI技術を活用した、より精度の高いマッチングシステムの運用を開始しました。',
      image: newsImage1
    },
    {
      category: '技術ブログ',
      date: '2024.03.10',
      title: 'マイクロサービスアーキテクチャの実践的アプローチ',
      description: '当社のバックエンド開発チームが採用している最新のアーキテクチャについて解説します。',
      image: blogImage1
    },
    {
      category: 'ニュース',
      date: '2024.03.05',
      title: '年間利用企業数が1000社を突破',
      description: '多くの企業様にご利用いただき、エンジニアマッチング件数も順調に増加しています。',
      image: newsImage2
    },
    // 追加のニュース記事
    {
      category: '技術ブログ',
      date: '2024.03.01',
      title: 'Reactアプリケーションのパフォーマンス最適化',
      description: 'フロントエンド開発チームによる、実践的なパフォーマンスチューニング手法をご紹介します。',
      image: blogImage1
    },
    {
      category: 'ニュース',
      date: '2024.02.28',
      title: '新規事業部門の設立について',
      description: 'AI技術研究開発に特化した新規事業部門を設立し、より革新的なサービス開発を推進します。',
      image: newsImage1
    },
    // さらに記事を追加...
  ];

  return (
    <div className={styles.archivePage}>
      <div className={styles.header}>
        <div className={styles.container}>
          <h1 className={styles.title}>ニュース＆ブログ</h1>
          <p className={styles.subtitle}>ReAliceの最新情報をお届けします</p>
        </div>
      </div>

      <div className={styles.container}>
        <div className={styles.filters}>
          <button className={`${styles.filterButton} ${styles.active}`}>すべて</button>
          <button className={styles.filterButton}>ニュース</button>
          <button className={styles.filterButton}>技術ブログ</button>
        </div>

        <div className={styles.newsGrid}>
          {newsItems.map((item, index) => (
            <article key={index} className={styles.newsCard}>
              <div className={styles.imageContainer}>
                <img src={item.image} alt="" className={styles.image} />
                <span className={styles.category}>{item.category}</span>
              </div>
              <div className={styles.content}>
                <time className={styles.date}>{item.date}</time>
                <h3 className={styles.newsTitle}>{item.title}</h3>
                <p className={styles.description}>{item.description}</p>
                <a href="#" className={styles.readMore}>
                  続きを読む
                  <span className={styles.arrow}>→</span>
                </a>
              </div>
            </article>
          ))}
        </div>

        <div className={styles.pagination}>
          <button className={styles.pageButton}>前へ</button>
          <div className={styles.pageNumbers}>
            <button className={`${styles.pageNumber} ${styles.active}`}>1</button>
            <button className={styles.pageNumber}>2</button>
            <button className={styles.pageNumber}>3</button>
          </div>
          <button className={styles.pageButton}>次へ</button>
        </div>
      </div>
    </div>
  );
};
